import React from 'react';

const navbar = () => {
  return (
    <div className='navbar'>
      <nav className='navbar'>
        <li>
            Home
        </li>
        <li>
            ABOUT
        </li>
        <li>
            CONTACT
        </li>
      </nav>
    </div>
  )
}

export default navbar;
